import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Main from "./pages/main/Main";
import Login from "./pages/mypage/Login";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Main />}></Route>
          <Route path='/login' element={<Login />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
